/** @format */

import React, { useEffect, useState } from "react";

const Input = ({ setPlace, setAddress, place }) => {
	const func = place => {
		console.log("object");
		if (place === 0)
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap`
			);
		else if (place === 1)
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=65.96191406250001%2C8.754794702435618%2C99.62402343750001%2C33.578014746144014&amp;layer=cyclemap`
			);
		else if (place === 2)
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-12.458496093750002%2C49.97948776108648%2C4.372558593750001%2C57.868131763328826&amp;layer=cyclemap`
			);
		else
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-183.515625%2C6.664607562172573%2C-48.86718750000001%2C74.4964131169431&amp;layer=cyclemap`
			);
	};
	return (
		<>
			<select
				placeholder='Find'
				id='voice-select'
				style={{
					height: "30px",
					width: "100px",
					zIndex: "31111111",
					position: "absolute",
					top: "5vh",
					left: "50vw",
					borderRadius: "8px",
					outline: "none",
				}}
				class='form-control form-control-lg'>
				<option value='World' onClick={func(0)}>
					World
				</option>
				<option value='India' onClick={func(1)}>
					India
				</option>
				<option value='UK' onClick={func(2)}>
					UK
				</option>
				<option value='USA' onClick={setPlace(3)}>
					USA
				</option>
			</select>
			<button
				style={{
					height: "30px",
					width: "100px",
					zIndex: "31111111",
					position: "absolute",
					top: "15vh",
					left: "50vw",
					borderRadius: "8px",
					outline: "none",
				}}
				onClick={func(2)}>
				Here
			</button>
		</>
	);
};

export default Input;
